import React from 'react';
import '../App.css';
import { NavLink } from 'react-router-dom';

function Homepage() {
  return (
    <div>This is Homepage.
      <nav className="navigation">
        <ul>
          <li>
            <NavLink exact to='/tutors'>Show me the tutors.</NavLink>
          </li>
          <li>
            <NavLink exact to='/students'>Show me the students.</NavLink>
          </li>
        </ul>
      </nav>

    </div>
  );
}

export default Homepage;
